INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, "2030/12/17 14:59:59", 0.0, 102301, 2, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 0.0, 0.0, "アヤネ", 401, 2, 24001, "2020/07/31 12:00:00", 24);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, "2030/12/17 14:59:59", 0.0, 102301, 1, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 0.0, 2.21, "アヤネ", 402, 2, 24002, "2020/07/31 12:00:00", 24);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, "2030/12/17 14:59:59", 0.0, 102301, 2, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 0.0, 0.0, "アヤネ", 403, 2, 24003, "2020/07/31 12:00:00", 24);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, "2030/12/17 14:59:59", 0.0, 192201, 2, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 0.0, 1.99, "アサヒ", 701, 1, 24004, "2020/07/31 12:00:00", 24);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, "2030/12/17 14:59:59", 0.0, 192201, 1, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 0.0, 2.21, "アサヒ", 702, 2, 24005, "2020/07/31 12:00:00", 24);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, "2030/12/17 14:59:59", 0.0, 192201, 2, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 0.0, 3.33, "アサヒ", 703, 1, 24006, "2020/07/31 12:00:00", 24);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, "2030/12/17 14:59:59", 0.0, 192301, 2, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 0.0, 0.0, "部員３", 801, 2, 24007, "2020/07/31 12:00:00", 24);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, "2030/12/17 14:59:59", 0.0, 192301, 1, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 0.0, 2.68, "部員３", 802, 2, 24008, "2020/07/31 12:00:00", 24);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, "2030/12/17 14:59:59", 0.0, 192301, 2, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 0.0, 0.0, "部員３", 803, 2, 24009, "2020/07/31 12:00:00", 24);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, "2030/12/17 14:59:59", 0.0, 192501, 1, "やった！", 0.0, 0.0, "", 501, 1, 24010, "2020/07/31 12:00:00", 24);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, "2030/12/17 14:59:59", 0.0, 192501, 1, "勝ったよ！", 0.0, 0.0, "", 502, 1, 24011, "2020/07/31 12:00:00", 24);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, "2030/12/17 14:59:59", 0.0, 192501, 1, "いい調子！", 0.0, 0.0, "", 503, 1, 24012, "2020/07/31 12:00:00", 24);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, "2030/12/17 14:59:59", 0.0, 113501, 6, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 0.0, 5.33, "ミサト", 111, 2, 24013, "2020/07/31 12:00:00", 24);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, "2030/12/17 14:59:59", 0.0, 113501, 1, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 0.0, 6.85, "ミサト", 112, 2, 24014, "2020/07/31 12:00:00", 24);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, "2030/12/17 14:59:59", 0.0, 113501, 1, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 0.0, 3.0, "ミサト", 113, 2, 24015, "2020/07/31 12:00:00", 24);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, "2030/12/17 14:59:59", 0.0, 192401, 1, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 0.0, 6.11, "ダイチ", 611, 2, 24016, "2020/07/31 12:00:00", 24);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, "2030/12/17 14:59:59", 0.0, 192401, 1, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 0.0, 6.75, "ダイチ", 612, 2, 24017, "2020/07/31 12:00:00", 24);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, "2030/12/17 14:59:59", 0.0, 192401, 2, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 0.0, 0.0, "ダイチ", 613, 2, 24018, "2020/07/31 12:00:00", 24);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, "2030/12/17 14:59:59", 0.0, 113401, 2, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 0.0, 4.52, "ハツネ", 211, 1, 24019, "2020/07/31 12:00:00", 24);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, "2030/12/17 14:59:59", 0.0, 113401, 2, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 0.0, 3.89, "ハツネ", 212, 1, 24020, "2020/07/31 12:00:00", 24);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, "2030/12/17 14:59:59", 0.0, 113401, 1, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 0.0, 13.49, "ハツネ", 213, 2, 24021, "2020/07/31 12:00:00", 24);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, "2030/12/17 14:59:59", 0.0, 106501, 1, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 0.0, 3.17, "カヤ", 311, 2, 24022, "2020/07/31 12:00:00", 24);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, "2030/12/17 14:59:59", 0.0, 106501, 1, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 0.0, 4.42, "カヤ", 312, 2, 24023, "2020/07/31 12:00:00", 24);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, "2030/12/17 14:59:59", 0.0, 106501, 6, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 0.0, 2.89, "カヤ", 313, 1, 24024, "2020/07/31 12:00:00", 24);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, "2030/12/17 14:59:59", 0.0, 102301, 4, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 0.0, 3.71, "アヤネ", 421, 3, 24025, "2020/07/31 12:00:00", 24);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, "2030/12/17 14:59:59", 0.0, 192201, 2, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 0.0, 5.1, "アサヒ", 721, 1, 24026, "2020/07/31 12:00:00", 24);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, "2030/12/17 14:59:59", 0.0, 192301, 1, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 0.0, 4.34, "部員３", 821, 3, 24027, "2020/07/31 12:00:00", 24);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, "2030/12/17 14:59:59", 0.0, 192501, 1, "いい勝負だったよ\nまたやろうね", 0.0, 0.0, "", 521, 1, 24028, "2020/07/31 12:00:00", 24);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, "2030/12/17 14:59:59", -360.0, 113501, 1, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 0.0, 5.62, "ミサト", 101, 2, 24029, "2020/07/31 12:00:00", 24);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, "2030/12/17 14:59:59", -360.0, 113501, 1, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 0.0, 9.58, "ミサト", 102, 2, 24030, "2020/07/31 12:00:00", 24);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, "2030/12/17 14:59:59", -360.0, 113501, 2, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 0.0, 0.0, "ミサト", 103, 2, 24031, "2020/07/31 12:00:00", 24);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, "2030/12/17 14:59:59", -360.0, 113501, 2, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 0.0, 9.13, "ミサト", 104, 1, 24032, "2020/07/31 12:00:00", 24);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (10046, "2030/12/17 14:59:59", -360.0, 113501, 1, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 0.0, 8.27, "ミサト", 105, 2, 24033, "2020/07/31 12:00:00", 24);
